using namespace std;


template <typename T>
inline T read()
{
	T spj = 0, flag = 1;
	char c = getchar();
	while (!isdigit(c))
	{
		if (c == '-') flag = -1;
		c = getchar();
	}
	while (isdigit(c))
	{
		spj = spj * 10 + c - 48;
		c = getchar();
	}
	return spj * flag;
}

